-- CREAZIONE TABELLA ateco --
IF NOT EXISTS(select * from sysobjects where id = object_id(N'[dbo].[ateco]') and OBJECTPROPERTY(id, N'IsUserTable') = 1)
BEGIN
CREATE TABLE [dbo].[ateco] (
idateco int NOT NULL,
codice varchar(50) NULL,
lt datetime NULL,
lu varchar(64) NULL,
title varchar(255) NULL,
 CONSTRAINT xpkateco PRIMARY KEY (idateco
)
)
END
GO

