BEGIN
	ALTER TABLE [ateco] ADD idateco int NOT NULL DEFAULT 0
	declare @vincolo varchar(100)
	select @vincolo = object_name(const.constid) from syscolumns col join sysconstraints const on const.id = col.id and const.colid = col.colid where col.id = object_id('ateco') and col.name = 'idateco' and objectproperty(const.constid, 'IsDefaultCnst')=1
	exec ('ALTER TABLE [ateco] drop constraint '+@vincolo)
END
GO

